import { Box, Paper, Grid, Typography, makeStyles } from '@material-ui/core'
import React from 'react'

const useStyles = makeStyles((theme) =>  ({
  root:{
    width:"100%",
    height:"100vh",
    display:"flex",
    justify:"center",
    alignContent:"center",
    backgroundColor:"#74b9ff"

  }
}))

function jokeGenerator() {
  const classes = useStyles();
  return (
    <Grid container className={classes.root}>
      <Grid item xs={10} sm={7} lg={6}>
        <Paper component={Box} p={2}>
          <Box display="flex" justifyContent="center" mb={4} mt={3}>
          <img src={require("./vendetta.jpg")} alt={"img"} />
          </Box>
          <Typography variant="h4" component="h6" align="center">
            Joke Generator
          </Typography>
        </Paper>
        </Grid></Grid>
  )
}

export default jokeGenerator
